      Заповеди Божии

      1. Почитай только одного истинного Бога.

      2. Не создавай себе кумиров (идолов), т.е не поклоняйся твари, но Творцу.

      3. Благоговейно произноси имя Божие, т.е не произноси его всуе, без нужды.

      4. Седьмой день недели посвящай Богу.

      5. Почитай отца твоего и мать, чтобы тебе было хорошо, и чтобы ты долго прожил на земле.

      6. Не убивай.

      7. Не кради.

      8. Будь верным, свято храни свою семью, не предавай её, береги её.

      9. Не обманывай.

      10. Не завидуй.
