  - content: >
      День третий? Четвёртый? Я не знаю сколько меня тут уже держат. Я пытаюсь объяснить всем, что они в опасности. 

      Меня не слушают, говорят, что мне нужна помощь 

      Но ОН всё ещё там, лежит в отделе, готовый в любую минуту вырваться и уничтожить нас всех 

      Я.. Я не могу позволить этого. Он придёт за мной, а потом и за другими...

      Врач приходит три раза в день, я смогла украсть шприц из его кармана, мне нужно действовать, пока он не заметил пропажу снотворного

      Я спасу нас всех.
